import Post from "../post/Post";
import "./posts.css";

export default function Posts({posts}) {
 
  console.log(`${posts.title} ${posts.desc} ${posts.createdAt}`)
 
  return (
    <div className="posts">
      
      {posts.map((p)=>{
          <Post post={p}/>
        })}
     
    </div>
  );
}
